El hotel sigue su marcha y crece cada día un poco más 😊, alumnos que entran y salen día a día para cambiar sus vidas 💛 en conjunto con sus dueños quienes llegan con ilusión y con la esperanza de cambiar la vida de sus mejores amigos 🐶.

Un lugar único en el país 🇺🇾

